We create NMT system for Uzbek-Karakalpak language pairs using various morphological and syntactic features to improve the quality of translation. 
<br>Neural Machine Translation (NMT) techniques for Turkish languages, with an emphasis in two important directions:
<br>1.	Analysis of their linguistic features for improving the quality of translation of Turkish languages.
<br>2.	Analiysis and building a robust NMT model which delivers efficient performance across different domains with a limited parallel corpus.
